(130, 237, 'Positions', 'positions', '<p>This Joomla! template supports a wide variety of module positions which can be archived automatically by the system.The module positions are fully collapsible mean that if there are no modules published in particular position, this module position will disappear and the other modules with take this place. Also you can have 2-Columns layout (content, left or right)</p>\r\n<div class="pages-position" style="margin: 0 0 20px;"><button class="btn btn-lg" type="button" data-toggle="modal" data-target="#myModal"> Position Layout1 </button> <!-- Modal -->\r\n<div id="myModal" class="modal fade bs-example-modal-lg" tabindex="-1">\r\n<div class="modal-dialog">\r\n<div class="modal-content">\r\n<div class="modal-header"><button class="close" type="button" data-dismiss="modal">×</button>\r\n<h4 class="modal-title">Position Layout 1</h4>\r\n</div>\r\n<div class="modal-body"><img src="images/position1.jpg" alt="position1" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- Button trigger modal --> <button class="btn btn-lg" type="button" data-toggle="modal" data-target="#myModal2"> Position Layout 2 </button> <!-- Modal -->\r\n<div id="myModal2" class="modal fade bs-example-modal-lg" tabindex="-1">\r\n<div class="modal-dialog">\r\n<div class="modal-content">\r\n<div class="modal-header"><button class="close" type="button" data-dismiss="modal">×</button>\r\n<h4 class="modal-title">Position Layout 2</h4>\r\n</div>\r\n<div class="modal-body"><img src="images/position2.jpg" alt="position2" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- Button trigger modal --> <button class="btn btn-lg" type="button" data-toggle="modal" data-target="#myModal3"> Position Layout 3 </button> <!-- Modal -->\r\n<div id="myModal3" class="modal fade bs-example-modal-lg" tabindex="-1">\r\n<div class="modal-dialog">\r\n<div class="modal-content">\r\n<div class="modal-header"><button class="close" type="button" data-dismiss="modal">×</button>\r\n<h4 class="modal-title">Position Layout 3</h4>\r\n</div>\r\n<div class="modal-body"><img src="images/position3.jpg" alt="position3" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', 1, 9, '2011-06-29 03:32:22', 721, '', '2015-11-04 09:50:10', 558, 558, '2015-11-04 09:50:10', '2011-06-29 03:32:22', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 26, 5, '', '', 1, 214, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
