(157, 279, 'Blockquote', 'blockquote', '<p>For quoting blocks of content from another source within your document.</p>\r\n<h3>Default blockquote</h3>\r\n<p>Wrap <code>&lt;blockquote&gt;</code> around any <abbr title="HyperText Markup Language">HTML</abbr>\r\nas the quote. For straight quotes we recommend a <code>&lt;p&gt;</code>.</p>\r\n\r\n<div class="bs-docs-example">\r\n     [quote align="none" border="#666" color="#666" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     <P>Vestibulum id urna eu tortor hendrerit iaculis sit amet in ipsum. Cras tempus ultrices leo, tempus iaculis eros tempor non.\r\n     Aenean ac nisl molestie ligula placerat porta non cursus neque. Phasellus sagittis est at lorem tincidunt consequat.</P>\r\n</div>\r\n<pre class="prettyprint linenums">&#91;quote width="auto" align="none" border="#666" color="#666" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n</pre>\r\n\r\n<h3>Blockquote options</h3>\r\n<p>Style and content changes for simple variations on a standard blockquote.</p>\r\n<div class="bs-docs-example">\r\n     [quote width="45%" align="left" border="#666" color="#666" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     <P>Vestibulum id urna eu tortor hendrerit iaculis sit amet in ipsum. Cras tempus ultrices leo, tempus iaculis eros tempor non.\r\n     Aenean ac nisl molestie ligula placerat porta non cursus neque. Phasellus sagittis est at lorem tincidunt.</P>\r\n</div>\r\n<pre class="prettyprint linenums">&#91;quote width="45%" align="left" border="#666" color="#666" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n</pre>\r\n\r\n<div class="bs-docs-example">\r\n     [quote width="45%" align="right" border="#666" color="#666" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     <P>Vestibulum id urna eu tortor hendrerit iaculis sit amet in ipsum. Cras tempus ultrices leo, tempus iaculis eros tempor non.\r\n     Aenean ac nisl molestie ligula placerat porta non cursus neque. Phasellus sagittis est at lorem tincidunt.</P>\r\n</div>\r\n<pre class="prettyprint linenums">&#91;quote width="45%" align="right" border="#666" color="#666" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n</pre>\r\n\r\n<div class="bs-docs-example">\r\n     [quote align="none" border="#468847" color="#468847" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     [quote align="none" border="#F89406" color="#F89406" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     [quote align="none" border="#B24745" color="#B24745" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     [quote align="none" border="#3A87AD" color="#3A87AD" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n</div>\r\n<pre class="prettyprint linenums">&#91;quote align="none" border="#468847" color="#468847" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n&#91;quote align="none" border="#F89406" color="#F89406" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n&#91;quote align="none" border="#B24745" color="#B24745" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n&#91;quote align="none" border="#3A87AD" color="#3A87AD" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n</pre>\r\n\r\n[space height="10"]<br/>\r\n<h4>Customization Options / Features</h4>\r\n<ul>\r\n<li><strong>Width :</strong> Select number unit (px, %, em...)</li>\r\n<li><strong>Align : </strong> Select position align (left, right, none)</li>\r\n<li><strong>Border :</strong>  Changes border color Blockquote  </li>\r\n<li><strong>Color :</strong> Changes text color Blockquote</li>\r\n<li><strong>Title :</strong> Someone famous in Source Title </li>\r\n</ul>', '', -2, 90, '2013-02-22 22:21:51', 721, '', '2013-04-03 08:33:11', 42, 0, '0000-00-00 00:00:00', '2013-02-22 22:21:51', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 16, 29, '', '', 1, 179, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(158, 280, 'List Style', 'list-style', '<h3>Unordered lists</h3>\r\n<p>A list of items in which the order does <em> not </em> explicitly matter.</p>\r\n<div class="row">\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="disc"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="disc"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="circle"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="circle"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="square"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="square"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="check"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="check"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="arrow"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="arrow"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="star"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="star"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n\r\n<div class="col-lg-4 first">\r\n    <div class="bs-docs-example">[list type="check" color="#6B82A2"]\r\n    [list_item]Lorem ipsum dolor sit amet[/list_item]\r\n    [list_item]Lorem ipsum dolor sit amet[/list_item]\r\n    [list_item]Lorem ipsum dolor sit amet[/list_item]\r\n    [list_item]Lorem ipsum dolor sit amet[/list_item]\r\n    [/list]</div>\r\n    <pre class="prettyprint linenums">&#91;list type="check" color="#6B82A2" &#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="arrow" color="#6B82A2"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="arrow" color="#6B82A2"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n\r\n<div class="col-lg-4 ">\r\n<div class="bs-docs-example">[list type="star" color="#6EAD18"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="check" color="#6B82A2" &#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n</div>\r\n<h3>Ordered lists</h3>\r\n<p>A list of items in which the order <em>does</em> explicitly matter.</p>\r\n<div class="row">\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="roman"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="roman"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="decimal"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="decimal"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="alpha"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="alpha"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n\r\n</div>\r\n<h3>Number Block</h3>\r\n<p>A list of items in which the order <em>does</em> explicitly matter.</p>\r\n<div class="row">\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="numblocks1"]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="numblocks1"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="numblocks2"]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="numblocks2"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="numblocks3"]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="numblocks3"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4 first">\r\n<div class="bs-docs-example">[list type="smallnumber1" ]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="smallnumber1"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="smallnumber2" ]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="smallnumber2"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="smallnumber3" ]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="smallnumber3"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4 first">\r\n<div class="bs-docs-example">[list type="smallnumber4" ]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="smallnumber4"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="smallnumber6" ]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="smallnumber6"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="smallnumber5" ]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet, consectetur adipiscing elit.[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="smallnumber5"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n</div>\r\n<p>[space height="10"]</p>\r\n<h4>Customization Options / Features</h4>\r\n<ul>\r\n<li><strong>type </strong> (optional) – more optional type list (disc, circle, square, check, arrow, star, roman, decimal, alpha, numblocks1...)</li>\r\n<li><strong>color</strong> (optional) – changes color of type list (disc, circle, square, check, arrow, star, roman, decimal, alpha)</li>\r\n</ul>', '', -2, 90, '2013-02-22 22:24:31', 721, '', '2015-01-28 03:51:29', 558, 0, '0000-00-00 00:00:00', '2013-02-22 22:24:31', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 67, 28, '', '', 1, 247, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(159, 281, 'Button', 'button', '<h2>Default buttons</h2>\r\n<p>Button styles can be applied to anything with the <code>.btn</code> class applied. However, typically you''ll want to apply these to only <code>&lt;a&gt;</code> and <code>&lt;button&gt;</code> elements for the best rendering.</p>\r\n\r\n[message_box type="warning" close="no"]\r\n<p>Ex: element icon="user" then name of icons is "fa-user".</p>\r\nYou can find the full examples of usage at Font Awesome - <a href="http://fortawesome.github.io/Font-Awesome/icons/" target="_blank">Font Awesome 4.0.3</a> \r\n[/message_box]\r\n\r\n<div class="bs-docs-example">\r\n<table class="table table-bordered table-striped">\r\n<thead>\r\n  <tr>\r\n    <th>Button</th>\r\n    <th>Type</th>\r\n    <th>Icon</th>\r\n    <th>Description</th>\r\n  </tr>\r\n</thead>\r\n<tbody>\r\n  <tr>\r\n    <td>[button icon="pencil" ]Default[/button]</td>\r\n    <td></td>\r\n    <td><code>pencil</code></td>\r\n    <td>Standard gray button with gradient</td>\r\n  </tr>\r\n  <tr>\r\n    <td>[button type="primary" icon="comment"]Primary[/button]</td>\r\n    <td><code>primary</code></td>\r\n     <td><code>comment</code></td>\r\n    <td>Provides extra visual weight and identifies the primary action in a set of buttons</td>\r\n  </tr>\r\n  <tr>\r\n     <td>[button type="info" icon="info-circle"]Info[/button]</td>\r\n    <td><code>info</code></td>\r\n     <td><code>info-circle</code></td>\r\n    <td>Used as an alternative to the default styles</td>\r\n  </tr>\r\n  <tr>\r\n    <td>[button type="success" icon="check"]Success[/button]</td>\r\n    <td><code>success</code></td>\r\n    <td><code>check</code></td>\r\n    <td>Indicates a successful or positive action</td>\r\n  </tr>\r\n  <tr>\r\n     <td>[button type="warning" icon="warning"]Warning[/button]</td>\r\n    <td><code>warning</code></td>\r\n    <td><code>warning</code></td>\r\n    <td>Indicates caution should be taken with this action</td>\r\n  </tr>\r\n  <tr>\r\n    <td>[button type="danger" icon="refresh"]Danger[/button]</td>\r\n    <td><code>danger</code></td>\r\n    <td><code>refresh</code></td>\r\n    <td>Indicates a dangerous or potentially negative action</td>\r\n  </tr>\r\n  <tr>\r\n    <td>[button type="inverse" icon="trash-o"]Inverse[/button]</td>\r\n    <td><code>inverse</code></td>\r\n    <td><code>trash-o</code></td>\r\n    <td>Alternate dark gray button, not tied to a semantic action or use</td>\r\n  </tr>\r\n  <tr>\r\n    <td>[button type="link" icon="twitter"]Link[/button]</td>\r\n    <td><code>link</code></td>\r\n    <td><code>twitter</code></td>\r\n    <td>Deemphasize a button by making it look like a link while maintaining button behavior</td>\r\n  </tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n\r\n<pre class="prettyprint linenums">\r\n&#91;button target="_self" link="#"&#93; Default icon="pencil" &#91;/button&#93;\r\n&#91;button type="primary" icon="comment" target="_self" link="#"&#93; Primary &#91;/button&#93;   \r\n&#91;button type="info" icon="info-sign" target="_self" link="#"&#93; Info &#91;/button&#93;   \r\n&#91;button type="success" icon="check" target="_self" link="#"&#93; Success &#91;/button&#93;   \r\n&#91;button type="warning" icon="warning" target="_self" link="#"&#93; warning &#91;/button&#93;   \r\n&#91;button type="danger" icon="refresh" target="_self" link="#"&#93; Danger &#91;/button&#93;   \r\n&#91;button type="inverse" icon="trash" target="_self" link="#"&#93; Inverse &#91;/button&#93;   \r\n&#91;button type="link" icon="twitter" target="_self" link="#"&#93; Link &#91;/button&#93;\r\n</pre>\r\n\r\n<h2>Flat buttons</h2>\r\n<div class="bs-docs-example">\r\n    [button type="flat"]Default Button[/button]\r\n    [button type="flat primary" ]Primary Button[/button]\r\n    [button type="flat success"]Success Button[/button]\r\n    [button type="flat warning"]Warning Button[/button]\r\n    \r\n    [button type="flat inverse" ]Inverse Button[/button]\r\n    [button type="flat info" ]Info Button[/button]\r\n    [button type="flat danger"]Danger Button[/button]\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;button type="flat" target="_self" link="#"&#93; Default Button &#91;/button&#93;\r\n&#91;button type="flat primary" target="_self" link="#"&#93; Primary Button &#91;/button&#93;\r\n&#91;button type="flat success" target="_self" link="#"&#93; Success Button &#91;/button&#93;\r\n&#91;button type="flat warning"  target="_self" link="#"&#93; Warning Button &#91;/button&#93;\r\n&#91;button type="flat inverse" target="_self" link="#"&#93; Inverse Button &#91;/button&#93;\r\n&#91;button type="flat info" target="_self" link="#"&#93; Info Button &#91;/button&#93;\r\n&#91;button type="flat danger" target="_self" link="#"&#93; Danger Button &#91;/button&#93;\r\n</pre>\r\n<!----------------------- Block space-------------------->\r\n<h2>Cross browser compatibility</h2>\r\n<p>IE9 doesn''t crop background gradients on rounded corners, so we remove it. Related, IE9 jankifies disabled <code>button</code> elements, rendering text gray with a nasty text-shadow that we cannot fix.</p>\r\n\r\n<h2>Button sizes</h2>\r\n<p>Fancy larger or smaller buttons? Add size= <code>large</code>, <code>small</code>, or <code>mini</code> for additional sizes.</p>\r\n\r\n<div class="bs-docs-example">\r\n<p>\r\n     [button type="primary" size="lg"]Large button[/button]\r\n     [button size="lg"]Large button[/button]\r\n  \r\n</p>\r\n<p>\r\n     [button type="primary" ]Default button[/button]\r\n     [button ]Default button[/button]\r\n \r\n</p>\r\n<p>\r\n     [button type="primary" size="sm"]Small button[/button]\r\n     [button size="sm"]Small button[/button]\r\n  \r\n</p>\r\n<p>\r\n     [button type="primary" size="xs"]Mini button[/button]\r\n     [button size="xs"]Mini button[/button]\r\n</p>\r\n</div>\r\n<pre class="prettyprint linenums">&#91;button type="primary" size="lg" target="_self" link="#"&#93; Large button &#91;/button&#93;\r\n&#91;button size="lg" target="_self" link="#"&#93; Large button &#91;/button&#93;\r\n\r\n&#91;button type="primary" target="_self" link="#"&#93; Default button &#91;/button&#93;\r\n&#91;button target="_self" link="#"&#93; Default button &#91;/button&#93;\r\n\r\n&#91;button type="primary" size="sm" target="_self" link="#"&#93; Small button &#91;/button&#93;\r\n&#91;button size="sm" target="_self" link="#"&#93; Large Small &#91;/button&#93;\r\n\r\n&#91;button type="primary" size="xs" target="_self" link="#"&#93; Mini button &#91;/button&#93;\r\n&#91;button size="xs" target="_self" link="#"&#93; Mini button &#91;/button&#93;\r\n</pre>\r\n\r\n<!----------------------- Block space-------------------->\r\n<p>Create block level buttons—those that span the full width of a parent— by adding .btn-block.</p>\r\n<div class="bs-docs-example">\r\n     <div style="max-width: 400px; margin: 0 auto 10px;" class="well">\r\n          [button type="primary" size="lg" full="block" ] Block level button[/button]\r\n          [button size="lg" full="block"] Block level button[/button]\r\n     </div>\r\n</div>\r\n<pre class="prettyprint linenums">&#91;button type="primary" size="lg" full="block"&#93; Block level button &#91;/button&#93;\r\n&#91;button size="lg" full="block"&#93; Block level button &#91;/button&#93;\r\n</pre>\r\n\r\n<!----------------------- Block space-------------------->\r\n<h2>Disabled state</h2>\r\n<p>For disabled buttons, add the state=<code>disabled</code> class to links and the <code>disabled</code> attribute for <code>&lt;button&gt;</code> elements.</p>\r\n<div class="bs-docs-example">\r\n     [button type="primary" size="lg" state="disabled" icon="edit"]Primary button[/button]\r\n     [button size="lg" state="disabled"]Button[/button]\r\n</div>\r\n<pre class="prettyprint linenums">&#91;button type="primary" size="lg" state="disabled"&#93; Primary button &#91;/button&#93;\r\n&#91;button size="lg" state="disabled"&#93; Button &#91;/button&#93;\r\n</pre>\r\n\r\n\r\n\r\n\r\n\r\n[space height="10"]<br/>\r\n<h4>Customization Options / Features</h4>\r\n<ul>\r\n    <li><strong>type : </strong>  style of the button. You can combine the following options(<i>primary, info, success, warning, danger, inverse, link, flat</i>) </li>\r\n    <li><strong>icon :</strong> add any mini-icon (from the <a href="index.php?option=com_content&view=article&id=174&Itemid=659">Icons</a> section) here.</li>\r\n    <li><strong>size :</strong> available sizes (<i> xs, sm, default, lg</i>)</li>\r\n    <li><strong>full  :</strong> the full width of a parent</li>\r\n    <li><strong>target :</strong> link target (eg. target="_blank" will open link in a new window)</li>\r\n    <li><strong>state :</strong> disabled buttons, available (<i> true, disabled</i>)</li>\r\n</ul>', '', -2, 90, '2013-02-22 22:39:01', 721, '', '2014-05-29 07:43:58', 558, 0, '0000-00-00 00:00:00', '2013-02-22 22:39:01', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 12, 27, '', '', 1, 220, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
