(163, 285, 'Lightbox', 'lightbox', 'With our 4 different style Lightbox : img-rounded, img-circle, img-thumbnail, shadow and borderInner.\r\neffects.\r\n<div class="bs-docs-example">\r\n \r\n    [lightbox src="http://placehold.it/224x190/00C0E4/FFFFFF" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" ]\r\n    [lightbox src="http://placehold.it/224x190/5BD999/FFFFFF" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" style="img-rounded" ] \r\n    [lightbox src="http://placehold.it/224x190/7658F8/FFFFFF" width="190" height="190" lightbox="on"  align="left" style="img-circle" ]  [clear]\r\n    [lightbox src="http://placehold.it/224x190/EAC14D/FFFFFF" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" style="img-thumbnail" ] \r\n    [lightbox src="http://placehold.it/224x190/C24867/FFFFFF" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" style="borderInner" ]\r\n    [lightbox src="http://placehold.it/224x190/CB70D7/FFFFFF" width="224" height="190" lightbox="on" title="Nulla ac convallis ipsum" align="left" style="shadow"]\r\n   \r\n</div>\r\n<pre class="prettyprint linenums">&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" &gt;\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="img-rounded" &gt;\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="img-circle" &gt;\r\n\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="img-thumbnail" &gt;\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="borderInner"&gt;\r\n&lt;lightbox src=''IMAGE_SRC'' width="224" height="190" title="IMAGE_TITLE" align="left" style="shadow"&gt;\r\n</pre>\r\n\r\n<!----------------------- Block space-------------------->\r\n\r\n<div class="