(199, 401, 'On scroll animations ', 'on-scroll-animations', ' <p>In the SJ Plus v2 template we have implemented the animation engine based on the <a target="_blank" href="http://julianlloyd.me/scrollreveal/">scrollReveal.js script</a>. This script makes creating elements onscroll animations very simple to define.</p>\r\n\r\n<p>Thanks to this script you can describe an animation using natural language.</p>\r\n\r\n<p>Description of the animation is placed in the <strong>data-scroll-reveal</strong> attribute:</p>\r\n\r\n<pre>&lt;!-- These 3 lines are equivalent --&gt;\r\n&lt;div data-scroll-reveal="enter left and move 50px over 1.33s"&gt; Foo &lt;/div&gt;\r\n&lt;div data-scroll-reveal="enter from the bottom after 1s"&gt; Bar &lt;/div&gt;\r\n&lt;div data-scroll-reveal="wait 2.5s and then ease-in-out 100px"&gt; Baz &lt;/div&gt;\r\n</pre>\r\n\r\n<p>The full description of the syntax is available on the project <a target="_blank" href="https://github.com/julianlloyd/scrollReveal.js">documentation page</a></p>   		              		            ', '', 1, 91, '2014-07-31 12:05:20', 721, '', '2014-07-30 14:13:55', 558, 0, '0000-00-00 00:00:00', '2014-07-31 12:05:20', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options