(10234, 'sj_matrix', 'template', 'sj_matrix', '', 0, 1, 1, 0, '{"name":"sj_matrix","type":"template","creationDate":"10\\/10\\/2015","author":"YouTech Company","copyright":"","authorEmail":"contact@ytcvn.com","authorUrl":"http:\\/\\/www.smartaddons.com","version":"1.0.0","description":"\\n\\t\\t\\n\\t\\t\\t<div style=\\"text-align:left;margin:0 0px 50px;\\">\\n\\t\\t\\t<h2>SJ Market - Responsive eCommerce Joomla 3.x Template for VirtueMart<\\/h2>\\n\\t\\t\\t<p>This template has all the in built functionality of YT Framework v3 . SJ Market comes with use shortcode such for video, gallery, slideshow, tabs, accordion etc. \\n\\t\\t\\tYT Framework 3.0 especially comes with rich administration features such as logo settings, layout builder,\\n\\t\\t\\tmega menu, unlimited fonts control.<\\/p>\\n\\t\\t\\t\\n\\t\\t\\t<h3 class=\\"clear\\">Key Features<\\/h3>\\n\\t\\t\\t<ul class=\\"yt-list type-check\\">\\n\\t\\t\\t\\t<li>Responsive Design supporting Phone, Tablets and Desktops<\\/li>\\n\\t\\t\\t\\t<li>Powered by Bootstrap and compatible with Joomla 3.0<\\/li>\\n\\t\\t\\t\\t<li>Sixed (6) styling with styling manager<\\/li>\\n\\t\\t\\t\\t<li>Uses latest web technologies like html5 and css3<\\/li>\\n\\t\\t\\t\\t<li>Uses shortcodes in built<\\/li>\\n\\t\\t\\t\\t<li>Built with LESS CSS<\\/li>\\n\\t\\t\\t\\t<li>Megamenu, RTL Support, CSS and JS compression and many more...<\\/li>\\n\\t\\t\\t<\\/ul>\\n\\t\\t\\t<\\/div>\\n\\t\\t\\n\\t","group":"yt_framework","filename":"templateDetails"}', '{"hideComponentHomePage":"0","favicon":"images\\/favicon.ico","logoType":"image","logoText":"SmartAddons.Com","sloganText":"The high quality products","logoWidth":"199","logoHeight":"40","copyright":"1","ytcopyright":"Copyright \\u00a9 {year} Sj Matrix. All Rights Reserved","joomla_create":"1","layouttype":"res","layoutFixed":"980","layoutFloat":"90","layoutRes":"1170","typelayout":"wide","bgbox":"pattern8","bgframed":"pattern8","bgrounded":"pattern8","templateLayout":"layout3","overrideLayouts":"494:variations","themecolor":"yellow","menutype":"mainmenu","menustyle":"mega","moofx":"easeInOutCirc","moofxtimeout":"150","keepMenu":"1","fancyMenu":"1","bodyFont":"Arial, Helvetica, sans-serif","bodySelectors":"body","menuFont":"Open+Sans","menuSelectors":"#menu a","headingFont":"Open+Sans","headingSelectors":"h1,h2,h3","otherSelectors":"","leading_width":"540","leading_height":"290","intro_width":"540","intro_height":"290","thumbnail_background":"#000000","thumbnail_mode":"fill","showCpanel":"0","showBacktotop":"1","animateScroll":"0","disableMootool":"1","stickyPanel":"right","stickyBar":"no","developing":"0","optimizeMergeFile":"0","optimizeCSS":"0","optimizeCSSExclude":"","optimizeJS":"0","optimizeJSExclude":"","optimizeFolder":"yt-assets","setGeneratorTag":"SmartAddons.Com - the high quality products!","enableGoogleAnalytics":"0","googleAnalyticsTrackingID":"","headAfter":"","headBefore":"","bodyAfter":"","bodyBefore":""}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
